#!/usr/bin/Rscript
#.libPaths("/usr/lib64/R/library/")

# This is part of interpolating monthly normals (max and min) to daily
# normals.

# usage:

# $0 ${prefix} ${directory} > /tmp/script

# creates a shell script which, when run in the appropriate context,
# does the actual downscaling.  The appropriate context is quite
# likely not the context in which you want to use it, so you will want
# to rewrite this section

# The DATA section of this script contains the coefficients for my
# choice of smoothing matrix, which puts (0.25, 0.5, 0.25) in each row
# with the 0.5 on the diagonal, wrapped around for the top and bottom
# rows.  If you want a different smoothing matrix, edit and run the
# octave code and put its output in the DATA section.


my $prefix = $ARGV[0];  # layers are $prefix<month>
# output layers are $prefixMMDD

my $outdir = $ARGV[1] ? $ARGV[1] : undef;

my $created_with = join(' ', ($0, @ARGV));

# print the shell header
print <<"EOH";
#!/bin/bash
# created with "$created_with"

g.region rast=${prefix}01
EOH

my ($mon, $day, @coefs);
while(<DATA>) {
    my @row = split;
    ($mon, $day, @coefs) = map { 0+$_ } @row; # force numeric treatment
    unshift @coefs, undef;		      # make Jan=1

    # construct a line which, when run, will build one day's map.
    # Most of the work is constructing the names of the map layers.
    # Here's a sample output line (for December 28th).  Here, $prefix
    # is 'x', x1228 is the output layer and x01 is the input layer for
    # January.

    #r.mapcalc 'x1228 = x01 * 0.407241 + x02 * -0.111315 + x03 *
    #0.028844 + x04 * -0.007757 + x05 * 0.001983 + x06 * -0.000254 +
    #x07 * -0.000973 + x08 * 0.004131 + x09 * -0.015768 + x10 *
    #0.058532 + x11 * -0.220700 + x12 * 0.856036'

    @terms = ();
    for $imon (1..12) {
	push @terms, sprintf( "%s%02d * %f",
			      $prefix, $imon, $coefs[$imon]);
    }
    my $rhs = join(' + ', @terms);
    my $lhs = sprintf("%s%02d%02d",  $prefix, $mon, $day);

    # this is just a progress indicator
    print "echo $lhs\n";

    # This is the important line of the script
    print "r.mapcalc '$lhs = $rhs'\n";

    # export the resulting map layers
    $oname = $lhs;
    if ($outdir) {
	print "r.out.gdal --quiet format=EHdr input=$lhs".
	    " output=$outdir/${oname}.bil nodata=-9999 type=Float32\n";
    }
}


